import React from 'react';

export default function SpeakersRenderProps(props){
    const speakers = [
        {
            imgSrc: 'speaker-component-1124.png',
            name: 'Douglas'
        },
        {
            imgSrc: 'speaker-component-1530.png',
            name: 'Tamara'
        },
        {
            imgSrc: 'speaker-component-10803.png',
            name: 'Eugene'
        }
    ];
    return props.children({speakers})
}
